-- ----------------------------
-- Records of food
-- ----------------------------
INSERT INTO `food` VALUES (90, 13, '猪肉', 38, 15, '猪肉又名豚肉，是主要家畜之一、猪科动物家猪的肉。其性味甘咸平，含有丰富的蛋白质及脂肪、碳水化合物、钙、铁、磷等营养成分 。猪肉是日常生活的主要副食品，具有补虚强身，滋阴润燥、丰肌泽肤的作用。凡病后体弱、产后血虚、面黄赢瘦者，皆可用之作营养滋补之品。', '元/斤', );
INSERT INTO `food` VALUES (91, 13, '鸡翅', 18, 5, '鸡翅又名鸡翼、大转弯，肉少、皮富胶质，又分“鸡膀”“膀尖”两种。鸡膀，连接鸡体至鸡翅的第一关节处，肉质较多；鸡翅有温中益气、补精添髓、强腰健胃等功效，鸡中翅相对翅尖和翅根来说，它的胶原蛋白含量丰富，对于保持皮肤光泽、增强皮肤弹性均有好处。', '元/斤', );
INSERT INTO `food` VALUES (92, 13, '牛肉', 58, 7, '指从牛身上获得的肉，为常见的肉品之一。来源可以是奶牛、公牛、小母牛。', '元/斤', );
INSERT INTO `food` VALUES (93, 28, '羊肉', 58, 8, '它既能御风寒，又可补身体，对一般风寒咳嗽、慢性气管炎、虚寒哮喘、肾亏阳痿、腹部冷痛、体虚怕冷、腰膝酸软、面黄肌瘦、气血两亏、病后或产后身体虚亏等一切虚状均有治疗和补益效果，最适宜于冬季食用，故被称为冬令补品，深受人们欢迎。', '元/斤', );
INSERT INTO `food` VALUES (94, 13, '鸭肉', 38, 10, '鸭是为餐桌上的上乘肴馔，也是人们进补的优良食品。鸭肉的营养价值与鸡肉相仿。但在中医看来，鸭子吃的食物多为水生物，故其肉性味甘、寒，入肺胃肾经，有滋补、养胃、补肾、除痨热骨蒸、消水肿、止热痢、止咳化痰等作用。', '元/斤', );
INSERT INTO `food` VALUES (95, 14, '番茄', 8, 19, '番茄，即西红柿，是管状花目、茄科、番茄属的一种一年生或多年生草本植物，体高0.6-2米，全体生粘质腺毛，有强烈气味，茎易倒伏，叶羽状复叶或羽状深裂，花序总梗长2-5厘米，常3-7朵花，花萼辐状，花冠辐状，浆果扁球状或近球状，肉质而多汁液，种子黄色，花果期夏秋季。', '元/斤', );
INSERT INTO `food` VALUES (96, 15, '土豆', 6, 5, '又名马铃薯，马铃薯，属茄科一年生草本植物，块茎可供食用，是全球第四大重要的粮食作物，仅次于小麦、稻谷和玉米。', '元/斤', );
INSERT INTO `food` VALUES (97, 16, '白菜', 6, 0, '白菜是我国原产蔬菜，有悠久的栽培历史。据考证，在我国新石器时期的西安半坡原始村落遗址发现的白菜籽距今约有6000年-7000年。明代李时珍引陆佃《埤雅》说：“菘，凌冬晚凋，四时常见，有松之操，故曰菘，今俗谓之白菜。”', '元/斤', );
INSERT INTO `food` VALUES (98, 18, '三文鱼', 88, 3, '三文鱼（Oncorhynchus），又名大马哈鱼、鲑鱼、撒蒙鱼，属硬骨鱼纲、鲑形目、鲑属，主要分布在大西洋与太平洋、北冰洋交界的水域，属于冷水性的高度洄游鱼类，被国际美食界誉为“冰海之皇”。研究表明，金枪鱼和三文鱼均肉质鲜美，营养丰富，并且富含EPA和DHA等生物活性物质。', '元/斤', );
INSERT INTO `food` VALUES (99, 19, '虾仁', 60, 4, '虾仁，一种食品，选用活虾为原料，用清水洗净虾体，去掉虾头、虾尾和虾壳。剥壳后的纯虾肉即为虾仁。虾仁菜肴因为清淡爽口，易于消化，老幼皆宜，而深受食客欢迎。', '元/斤', );
INSERT INTO `food` VALUES (100, 20, '蛤蜊 ', 18, 8, '蛤蜊属于软体动物门，异齿亚纲，帘蛤目，蛤蜊总科，蛤蜊科。该科动物有暖水种也有热水种，世界各大洋都有分布。我国沿海已发现30多种，多栖息在潮间带的中、下区和潮下带百米以内的浅海海底，少数能生活在百米以上的深海，营穴居生活。蛤蜊科的动物具有很高的经济价值，肉鲜嫩味美，营养丰富，也是我国的滩涂养殖的主要品种。', '元/斤', );
INSERT INTO `food` VALUES (101, 28, '咸蛋', 10, 9, '咸蛋又称腌鸭蛋、咸鸭蛋，古称咸杬子，是一种中国传统食品，以江苏高邮所产的咸鸭蛋最为有名。不少中国食品如粽、月饼也会加入咸鸭蛋黄。其中广东月饼越多鸭蛋黄，价钱亦越矜贵，蛋黄以出油“颜色红而油多”为上品。', '元/斤', );
INSERT INTO `food` VALUES (102, 28, '松花蛋', 10, 5, '松花蛋，又称皮蛋、灰包蛋、包蛋等，是一种中国传统风味蛋制品。主要原材料是鸭蛋，也可以是鸡蛋，口感鲜滑爽口，微咸，色香味均有独到之处。松花蛋不仅为国内广大消费者所喜爱，在国际市场上也享有盛名。经过特殊的加工方式后，松花蛋会变得黝黑光亮，上面还有白色的花纹，闻一闻则有一种特殊的香气扑鼻而来，是人民群众喜欢的美食之一。', '元/斤', );
INSERT INTO `food` VALUES (103, 22, '牛奶', 10, 20, '牛奶是最古老的天然饮料之一，被誉为白色血液。牛奶中含有丰富的蛋白质、脂肪、维生素和矿物质等营养物质。乳蛋白中含有人体所必须的氨基酸；乳脂肪多为短链和中链脂肪酸，极易被人体吸收；钾、磷、钙等矿物质配比合理，易于人体吸收。', '元/1000ml/瓶', );
INSERT INTO `food` VALUES (104, 23, '豆腐', 4, 65, '豆腐是中国的传统食品，味美而养生。也是我国素食菜肴的主要原料，在先民记忆中刚开始很难吃，经过不断的改造，逐渐受到人们的欢迎，被人们誉为“植物肉”。豆腐可以常年生产，不受季节限制，因此在蔬菜生产淡季，可以调剂菜肴品种。', '元/800g/盒', );
INSERT INTO `food` VALUES (105, 24, '面粉', 9, 18, '面粉是一种由小麦磨成的粉状物。按面粉中蛋白质含量的多少，可以分为高筋面粉、中筋面粉、低筋面粉及无筋面粉。面粉（小麦粉）是中国北方大部分地区的主食，用面粉制成的食物品种繁多，花样百出，风味迥异', '元/500g/袋', );
INSERT INTO `food` VALUES (106, 25, '黑芝麻', 13, 55, '黑芝麻含有大量的脂肪和蛋白质，还含有糖类、维生素A、维生素E、卵磷脂、钙、铁、铬等营养成分。有健胃、保肝、促进红细胞生长的作用，同时可以增加体内黑色素，有利于头发生长。', '元/斤', );
INSERT INTO `food` VALUES (107, 26, '酸菜', 17, 30, '酸菜在我们的饮食中可以是开胃小菜、下饭菜，也可以作为调味料来制作菜肴，可分为东北酸菜、四川酸菜、贵州酸菜、云南富源酸菜、德国酸菜等，不同地区的酸菜口味风格也不尽相同。老百姓常说的“酸菜”一般指的是所有青菜或白菜所做的所有种类酸菜的总称。', '元/1000g/袋', );
INSERT INTO `food` VALUES (108, 26, '火腿', 138, 5, '火腿,是腌制或熏制的动物的腿(如牛腿、羊腿、猪腿、鸡腿)，是经过盐渍、烟熏、发酵和干燥处理的腌制动物后腿，一般用猪后腿或是以猪、牛肉的肉泥，添加淀粉与食品添加剂，压制成成的“三明治火腿”，又名“火肉”、“兰熏”。中国传统特色美食。原产于浙江金华，现代以浙江金华和江苏如皋，江西安福与云南宣威出产的火腿最有名。', '元/1000g/盒', );
INSERT INTO `food` VALUES (109, 16, '芥菜', 5, 0, '中国各地栽培。叶盐腌供食用；种子及全草供药用，能化痰平喘，消肿止痛；种子磨粉称芥末，为调味料；榨出的油称芥子油；本种为优良的蜜源植物。', '元/斤', );
INSERT INTO `food` VALUES (110, 27, '红辣椒', 6, 80, '茎近无毛或微生柔毛，分枝稍之字形折曲。叶互生，枝顶端节不伸长而成双生或簇生状，矩圆状卵形、卵形或卵状披针形，全缘，顶端短渐尖或急尖，基部狭楔形；花单生，俯垂；花萼杯状，不显著5齿；花冠白色，裂片卵形；花药灰紫色。果梗较粗壮，俯垂；果实长指状，顶端渐尖且常弯曲，未成熟时绿色，成熟后成红色、橙色或紫红色，味辣。种子扁肾形，淡黄色。', '元/斤', );
INSERT INTO `food` VALUES (111, 27, '盐', 5, 55, '做菜必备', '元/500g/袋', NULL);
INSERT INTO `food` VALUES (112, 27, '大蒜', 25, 5, '大蒜整棵植株具有强烈辛辣的蒜臭味，蒜头、蒜叶(青蒜或蒜苗)和花薹(蒜薹)均可作蔬菜食用，不仅可作调味料，而且可入药，是著名的食药两用植物', '元/斤', NULL);
INSERT INTO `food` VALUES (113, 27, '冰糖', 8, 8, '冰糖是白砂糖煎炼而成的冰块状结晶，是由蔗糖加上蛋白质原料配方，经再溶、洁净处理后重结晶而制得的大颗粒结晶糖，有单晶体和多晶体两种，呈透明或半透明状。由于其结晶如冰状，故名冰糖，也叫“冰粮”。自然生成的冰糖有白色、微黄、淡灰等色，此外市场上还有添加食用色素的各类彩色冰糖（主要用于出口）。', '元/600g/袋', NULL);
INSERT INTO `food` VALUES (114, 30, ' 金针菇', 8.5, 6.5, '金针菇别名冬菇、朴蕈、绒毛柄金钱菌等，属真菌门、担子菌亚门、层菌纲、伞菌目、口蘑科、金钱菌属。金针菇在自然界广为分布，中国、日本、俄罗斯、欧洲、北美洲、澳大利亚等地均有种植。金针菇在我国分布广泛，栽培历史十分悠久，北起黑龙江，南至云南，东起江苏，西至新疆均适合金针菇的生长。', '元/斤', NULL);
INSERT INTO `food` VALUES (115, 27, '青辣椒', 8, 15, '茎近无毛或微生柔毛，分枝稍之字形折曲。叶互生，枝顶端节不伸长而成双生或簇生状，矩圆状卵形、卵形或卵状披针形，全缘，顶端短渐尖或急尖，基部狭楔形；花单生，俯垂；花萼杯状，不显著5齿；花冠白色，裂片卵形；花药灰紫色。果梗较粗壮，俯垂；果实长指状，顶端渐尖且常弯曲，未成熟时绿色，成熟后成红色、橙色或紫红色，味辣。种子扁肾形，淡黄色。', '元/斤', NULL);
INSERT INTO `food` VALUES (116, 27, '醋', 10, 5, '醋（Vinegar [1]  ）是中国各大菜系中传统的调味品 [2]  。据现有文字记载，中国古代劳动人民以酒作为发酵剂来发酵酿制食醋，东方醋起源于中国，据有文献记载的酿醋历史至少也在三千年以上。“醋”中国古称“酢”、“醯”、“苦酒”等。“酉”是“酒”字最早的甲骨文。同时把“醋”称之为“苦酒”，也同样说明“醋”是起源于“酒”的。', '元/500ml/瓶', NULL);
INSERT INTO `food` VALUES (117, 27, '生抽', 15.5, 6, '生抽是酱油的一种，是以大豆或黑豆、面粉为主要原料，人工接入种曲，经天然露晒，发酵而成的，颜色比较淡并且呈红褐色。\n老抽是用来做一般的烹调用的，味道较咸。生抽主要是用来调味，颜色淡，故做一般的炒菜或者凉菜的时候用得比较多。\n以优质黄豆和面粉为原料，经发酵成熟后提取而成。色泽淡雅醇香，酱香浓郁，味道鲜美。', '元/500ml/瓶', NULL);
INSERT INTO `food` VALUES (118, 27, '香油', 15, 89, '香油 ，是从芝麻中提炼出来的，具有特别香味，故称为香油。 按榨取方法一般分为压榨法、压滤法和水代法，小磨香油为传统工艺水代法制作的香油。', '元/1500ml/瓶', NULL);
INSERT INTO `food` VALUES (119, 13, '鸡爪', 9, 156, '鸡爪', '元/斤', NULL);
INSERT INTO `food` VALUES (120, 27, '小米椒', 5, 415, '小米椒', '元/斤', NULL);
INSERT INTO `food` VALUES (121, 27, '线椒', 65, 1456, '线辣椒是我国干制辣椒的一个重要类型，在陕西等部分中西部省区有规模化种植。', '元/斤', NULL);
INSERT INTO `food` VALUES (122, 33, '柠檬', 35, 484, '为双子叶植物纲芸香科柑橘属植物，柠檬又称柠果、洋柠檬、益母果等。 [1]  小乔木，枝少刺或近于无刺，嫩叶及花芽暗紫红色，叶片厚纸质，卵形或椭圆形。单花腋生或少花簇生。果椭圆形或卵形，果皮厚，通常粗糙，柠檬黄色，果汁酸至甚酸，种子小，卵形，端尖；种皮平滑，子叶乳白色，通常单或兼有多胚。花期4-5月，果期9-11月。', '元/斤', NULL);
INSERT INTO `food` VALUES (123, 27, '蚝油', 14, 47, '蚝油是用蚝（牡蛎）熬制而成的调味料。蚝油是广东常用的传统的鲜味调料，也是调味汁类最大宗产品之一，它以素有\"海底牛奶\"之称的蚝牗牡蛎牍为原料，经煮熟取汁浓缩，加辅料精制而成。', '元/斤', NULL);
INSERT INTO `food` VALUES (124, 27, '生姜', 5, 41, '别名有姜根、百辣云、勾装指、因地辛、炎凉小子、鲜生姜、蜜炙姜。姜的根茎（干姜）、栓皮（姜皮）、叶（姜叶）均可入药。生姜在中医药学里具有发散、止呕、止咳等功效。', '元/斤', NULL);
INSERT INTO `food` VALUES (125, 27, '花椒', 45, 52, '是芸香科、花椒属落叶小乔木，高可达7米；茎干上的刺，枝有短刺，当年生枝被短柔毛。叶轴常有甚狭窄的叶翼；小叶对生，卵形，椭圆形，稀披针形，叶缘有细裂齿，齿缝有油点。叶背被柔毛，叶背干有红褐色斑纹。花序顶生或生于侧枝之顶，花被片黄绿色，形状及大小大致相同；花柱斜向背弯。果紫红色，散生微凸起的油点，花期4-5月，果期8-9月或10月。', '元/500g/袋', NULL);
INSERT INTO `food` VALUES (126, 34, '黄瓜', 9, 10, '111', '元/斤', );

