-- ----------------------------
-- Records of foodtype
-- ----------------------------
INSERT INTO `foodtype` VALUES (13, '肉类', '肉类，是动物的皮下组织及肌肉，可以食用。其富含大量的蛋白质和脂肪，以及卡路里，其属于酸性食物。肉类含蛋白质丰富，一般在10-20%之间。瘦肉比肥肉含蛋白质多。');
INSERT INTO `foodtype` VALUES (14, '果实类蔬菜', '被子植物的雌蕊经过传粉受精，由子房或花的其他部分（如花托、萼片等）参与发育而成的器官。果实一般包括果皮和种子两部分，其中，果皮又可分为外果皮、中果皮和内果皮。种子起传播与繁殖的作用。');
INSERT INTO `foodtype` VALUES (15, '根茎蔬菜', '所谓根茎类蔬菜就是指使用部分为根或者茎');
INSERT INTO `foodtype` VALUES (16, '叶类蔬菜', '叶莱类。这类蔬菜以普通叶片或叶球、叶丛、变态叶为产品器官。');
INSERT INTO `foodtype` VALUES (17, '汤粥主食', '汤羹 饭 饼 粥');
INSERT INTO `foodtype` VALUES (18, '鱼', '水产鱼');
INSERT INTO `foodtype` VALUES (19, '虾', '河海虾类');
INSERT INTO `foodtype` VALUES (20, '贝', '有壳的软体动物');
INSERT INTO `foodtype` VALUES (22, '奶制品', '指的是使用牛乳或羊乳及其加工制品为主要原料，加入或不加入适量的维生素、矿物质和其他辅料，使用法律法规及标准规定所要求的条件，经加工制成的各种食品，也叫奶油制品');
INSERT INTO `foodtype` VALUES (23, '豆制品', '豆制品是以大豆、小豆、绿豆、豌豆、蚕豆等豆类为主要原料，经加工而成的食品。大多数豆制品是大豆的豆浆凝固而成的豆腐及其再制品。');
INSERT INTO `foodtype` VALUES (24, '米面类', '对谷类、豆类等粮食和油料及其加工成品和半成品的统称,是人类主要食物的统称。');
INSERT INTO `foodtype` VALUES (25, '干果类', '干果，即果实果皮成熟后为干燥状态的果子。干果又分为裂果和闭果，它们大多含有丰富的蛋白质，维生素，脂质等。');
INSERT INTO `foodtype` VALUES (26, '腌咸制品', '腌制就是让食盐大量渗入食品组织内来达到保藏食品的目的，这些经过腌制加工的食品称为腌制品。盐腌制品有腌菜、腌肉、腌禽蛋等。');
INSERT INTO `foodtype` VALUES (27, '佐料及其他', '无法明确区分类别的食材调理等');
INSERT INTO `foodtype` VALUES (28, '蛋类', '蛋类');
INSERT INTO `foodtype` VALUES (30, '菌菇类', '菇类即蕈类，是大型、高等的真菌，子实体通常肉眼可见。菌丝具横隔壁，将菌丝分隔成多细胞。通称菇、菇类。');
INSERT INTO `foodtype` VALUES (33, '水果', '水果，是指多汁且主要味觉为甜味和酸味，可食用的植物果实。水果不但含有丰富的维生素营养，而且能够促进消化。');
INSERT INTO `foodtype` VALUES (34, '1', '1');

