INSERT INTO `menu` VALUES (11, 12, '自制酸菜', '不开胃的时候，吃点酸菜还是极好的。外面买的多数是加醋精速成的，总少了些味道，，，\n以前做酸菜很小心还是容易失败认识了四川的阿姨，教会了做，一直没失败过，，，，，', 0, 0, 9, );
INSERT INTO `menu` VALUES (12, 12, '凉拌金针菇', '真的美味啊，手法很家常，但是味道绝对不家常，哈哈，赶紧发出来，还得给孩子们洗衣服呢，，半夜了', 0, 0, 2, );
INSERT INTO `menu` VALUES (13, 12, '停不下来的秘制凉拌鸡爪', '如果周末不出去玩，我一定是吹着空调啃着鸡爪追着剧，吃起来简直停不下来，虽然辣的也是够可以，但是真的是越吃越好吃，越好吃越停不下来。这个鸡爪也是家有来宾的必做菜，当然前提是爱吃辣。简直是让人念念不忘呀，吃过的都说好吃！还是那句话食材简单，程序简单，任何人都能做成功！', 0, 0, 6, );
INSERT INTO `menu` VALUES (14, 13, '百吃不厌的面疙瘩汤', '某位先生说天天吃饭也会吃腻了，于是就想着是不是需要变点花样啦！嗯，要不来一碗香气四溢的面疙瘩汤吧，简单方便又好吃，应该会是一个不错的选择哦！', 0, 0, 2, );
INSERT INTO `menu` VALUES (15, 14, '1', '1', 0, 0, 0, NULL);
INSERT INTO `menu` VALUES (16, 12, '麻辣香锅', '1', 8, 1, 5, NULL);

