INSERT INTO `menustep` VALUES (44, 11, 1, '洗干净可密封的玻璃罐，加入清水放入适量的盐，可多不要少，少了菜容易烂。多了的话快变酸。也没啥影响', );
INSERT INTO `menustep` VALUES (45, 11, 2, '放入蒜头，辣椒，生姜。冰糖也放入，作用是口感更加爽脆。这样酸菜泡好后带点辣味，很好吃，', );
INSERT INTO `menustep` VALUES (48, 11, 3, '这是空心菜的梗，泡酸后炒辣椒吃，最好加点腐乳。', NULL);
INSERT INTO `menustep` VALUES (49, 11, 7, '可以吧。之后的水可以再利用的，重复买菜放进泡。有时要适当加一点盐哦。', NULL);
INSERT INTO `menustep` VALUES (50, 12, 1, '买的是这样的金针菇，头切下去，撕成一撮撮的下开水抄熟，过凉摆盘', );
INSERT INTO `menustep` VALUES (51, 12, 2, '辣椒一把，青辣椒一个，葱姜蒜各一把装碗里，', NULL);
INSERT INTO `menustep` VALUES (52, 12, 3, '锅里热油冒烟冲好', NULL);
INSERT INTO `menustep` VALUES (53, 12, 4, '这碗是调味品啦，，生抽2瓶盖，老抽一点点，醋1瓶盖，白糖一小把，盐少量，因为酱油咸的，耗油来一点点，调好和辣椒油倒一起搅拌好，让盐和糖化开', NULL);
INSERT INTO `menustep` VALUES (54, 12, 5, '喜欢吃蒜蓉口味的可以在调味品碗里加点蒜蓉辣酱，，味道绝了，', );
INSERT INTO `menustep` VALUES (55, 12, 6, '哈哈，，干净不，汤都舍不得倒点，今天俺还喝点啤酒', NULL);
INSERT INTO `menustep` VALUES (57, 13, 2, '清水泡半个小时', NULL);
INSERT INTO `menustep` VALUES (58, 13, 3, '剁鸡爪，我一般剁三截，如图示！（慢点哟，小心手手）', NULL);
INSERT INTO `menustep` VALUES (59, 13, 4, '煮鸡爪，冷水下锅，放四片姜，料酒和五粒花椒，这样可以去腥，水开了煮十分钟，筷子扎的时候能轻松扎透了即可！', NULL);
INSERT INTO `menustep` VALUES (60, 13, 1, '你如果问我做鸡爪哪步最麻烦，那我肯定会说给鸡爪剪指甲，我记得第一次剪指甲是用✂️，差点没把手剪残，直到有一次逛超市发现了个神器，给宠物剪指甲的小剪刀，剪起鸡爪简直不要忒轻松哦，一会会就剪好啦！', NULL);
INSERT INTO `menustep` VALUES (61, 13, 5, '煮好的鸡爪放到冷水里面过水，这样的鸡爪更劲道！', NULL);
INSERT INTO `menustep` VALUES (62, 13, 6, '米椒、线椒、蒜切碎，四片姜切成丝，（记得戴手套，要不然手会疼）柠檬切三片，把冰糖也搞碎了，如果你们家的是一粒一粒的就直接放，材料放盆里。', NULL);
INSERT INTO `menustep` VALUES (63, 13, 7, '里面加生抽、醋、蚝油，具体加多少根据你们的米椒和线椒来决定，醋和生抽1:1 量没过米椒线椒和蒜末即可。味道可以调整，自己吃着满意就好！', NULL);
INSERT INTO `menustep` VALUES (64, 13, 8, '把步骤7的汁浇到鸡爪上HOHO！口水已经要流出来了！', NULL);
INSERT INTO `menustep` VALUES (65, 13, 9, '拌好了放冰箱冷藏一晚上', NULL);
INSERT INTO `menustep` VALUES (66, 13, 10, '入味的鸡爪更好吃，吃起来听不下来哟！', NULL);
INSERT INTO `menustep` VALUES (67, 16, 3, '3', NULL);
INSERT INTO `menustep` VALUES (68, 16, 12, 'aa', );

